import React, { Component, Fragment } from "react";
import { Link } from "react-router-dom";
import Button from "./form-components/Button";

export default class Chicks extends Component {
    state = {
        genres: [],
        isLoaded: false,
        error: null,
    };
    render() {
            return (
                <Fragment>
                    <h2>Chicks</h2>

                    <div className="list-group">
                        <Button/>
                    </div>
                </Fragment>
            );
        }
}
